import React from 'react';
import {View, Text } from 'react-native';

import NavBar from '../components/NavBar/NavBar.js';

export default function Search({navigation}) {
  return (
      <View>
          <Text>"Search"</Text>
          <NavBar navigation={navigation} username={username}/>
      </View>
  )
}
